import { useEffect, useState } from 'react';
import { api } from '../services/api';
import styles from '../css/Produtos.module.css';



type Insumo = {
  id: number;
  nome: string;
  unidadeMedida?: string;
};

type InsumoNecessario = {
  id: number;
  quantidadeNecessaria: number;
  insumo: Insumo;
};

type Produto = {
  id: number;
  nome: string;
  descricao: string;
  insumosNecessarios: InsumoNecessario[];
};

type OrdemProducao = {
  produtoId: number;
  quantidade: number;
  nomeCliente: string;
  pedidoVenda: string;
};

export function NovoProduto() {
  const [produtos, setProdutos] = useState<Produto[]>([]);
  const [novoProduto, setNovoProduto] = useState({ nome: '', descricao: '', valorUnitario: 0 });
  const [editandoId, setEditandoId] = useState<number | null>(null);
  const [editProduto, setEditProduto] = useState({ nome: '', descricao: '' });
  const [mostrarInsumosId, setMostrarInsumosId] = useState<number | null>(null);
  const [ordens, setOrdens] = useState([]);
  const [novaOrdem, setNovaOrdem] = useState<OrdemProducao>({ produtoId: 0, quantidade: 0, nomeCliente: '', pedidoVenda: '' });

  const criarProduto = async (e: React.FormEvent) => {
    e.preventDefault();
    await api.post('/produtos', novoProduto);
    setNovoProduto({ nome: '', descricao: '', valorUnitario: 0 });
    api.get('/produtos').then(res => setProdutos(res.data));
  };

  const criarOrdem = async (e: React.FormEvent) => {
    e.preventDefault();
    await api.post('/ordens-producao', novaOrdem);
    setNovaOrdem({ produtoId: 0, quantidade: 0, nomeCliente: '', pedidoVenda: '' });
    api.get('/ordens-producao').then(res => setOrdens(res.data));
  };

  const iniciarEdicao = (produto: Produto) => {
    setEditandoId(produto.id);
    setEditProduto({ nome: produto.nome, descricao: produto.descricao });
  };

  const salvarEdicao = async (id: number) => {
    await api.patch(`/produtos/${id}`, editProduto);
    setEditandoId(null);
    api.get('/produtos').then(res => setProdutos(res.data));
  };

  const excluirProduto = async (id: number) => {
    await api.delete(`/produtos/${id}`);
    api.get('/produtos').then(res => setProdutos(res.data));
  };

  useEffect(() => {
    api.get('/produtos').then(res => setProdutos(res.data));
  }, []);

  useEffect(() => {
    api.get('/ordens-producao').then(res => {
      setOrdens(res.data);
      console.log(res.data); // Veja se produto.valorUnitario estÃ¡ presente
    });
  }, []);

  return (
    <div>
      <h1>Incluir Produtos</h1>
      <form onSubmit={criarProduto} className={styles.formContainer}>
        <div className={styles.formGroup}>
          <label className={styles.label}>Nome do Produto:</label>
          <input
            className={styles.input}
            placeholder="Nome"
            value={novoProduto.nome}
            onChange={e => setNovoProduto({ ...novoProduto, nome: e.target.value })}
            required
          />
          <label className={styles.label}>DescriÃ§Ã£o:</label>
          <input
            className={styles.input}
            placeholder="DescriÃ§Ã£o"
            value={novoProduto.descricao}
            onChange={e => setNovoProduto({ ...novoProduto, descricao: e.target.value })}
          />
          <label className={styles.label}>Valor UnitÃ¡rio:</label>
          <input
            className={styles.input}
            placeholder="Valor UnitÃ¡rio"
            type="number"
            value={novoProduto.valorUnitario}
            onChange={e => setNovoProduto({ ...novoProduto, valorUnitario: Number(e.target.value) })}
          />
          <button type="submit">Adicionar Produto</button>
        </div>
      </form>

      <h1>Criar Ordem de ProduÃ§Ã£o</h1>
      <form onSubmit={criarOrdem}>
        <div>
          <label>Produto:</label>
          <select
            value={novaOrdem.produtoId}
            onChange={e => setNovaOrdem({ ...novaOrdem, produtoId: Number(e.target.value) })}
            required
          >
            <option value="">Selecione</option>
            {produtos.map(p => (
              <option key={p.id} value={p.id}>{p.nome}</option>
            ))}
          </select>
        </div>
        <div>
          <label>Quantidade:</label>
          <input
            type="number"
            min={1}
            value={novaOrdem.quantidade}
            onChange={e => setNovaOrdem({ ...novaOrdem, quantidade: Number(e.target.value) })}
            required
          />
        </div>
        <div>
          <label>Nome do Cliente:</label>
          <input
            type="text"
            value={novaOrdem.nomeCliente}
            onChange={e => setNovaOrdem({ ...novaOrdem, nomeCliente: e.target.value })}
          />
        </div>
        <div>
          <label>Pedido de Venda:</label>
          <input
            type="text"
            value={novaOrdem.pedidoVenda}
            onChange={e => setNovaOrdem({ ...novaOrdem, pedidoVenda: e.target.value })}
          />
        </div>
        <button type="submit">Criar Ordem</button>
      </form>
    </div>
  );
}
